import React, { useState } from "react";
import FullCalendar from "@fullcalendar/react";
import dayGridPlugin from "@fullcalendar/daygrid";
import timeGridPlugin from "@fullcalendar/timegrid";
import interactionPlugin from "@fullcalendar/interaction";

import "../Layout.css";

export default function Events() {
  const [events, setEvents] = useState([
    {
      title: "Test Event",
      start: "2025-11-01T10:00:00",
      end: "2025-11-01T12:00:00",
      description: "Detta är ett test-event med fullständig information."
    },
    {
      title: "Möte med styrelsen",
      start: "2025-11-05T18:00:00",
      end: "2025-11-05T20:00:00",
      description: "Vi diskuterar planerade aktiviteter och budget."
    }
  ]);

  const handleEventClick = (clickInfo) => {
    alert(`${clickInfo.event.title}\n\n${clickInfo.event.extendedProps.description}`);
  };

  return (
    <div className="outer-card">
      <div className="inner-card">
        <div className="inner-card-content">
          <div className="calendar-container">
            <FullCalendar
              plugins={[dayGridPlugin, timeGridPlugin, interactionPlugin]}
              initialView="dayGridMonth"
              events={events}
              eventClick={handleEventClick}
              headerToolbar={{
                left: "prev,next today",
                center: "title",
                right: "dayGridMonth,timeGridWeek,timeGridDay"
              }}
              height="auto"
            />
          </div>
        </div>
      </div>
    </div>
  );
}
